Equality for two `UniqueArc`s.

Two `UniqueArc`s are equal if their inner values are equal.

# Examples

```
#![feature(unique_rc_arc)]
use std::sync::UniqueArc;

let five = UniqueArc::new(5);

assert!(five == UniqueArc::new(5));
